// src/pages/HomeDesktop.tsx

import React from "react";

// Assets
import donutRight from "../assets/home_desktop/home_desktop_donut_right.png";
import donutLeft from "../assets/home_desktop/home_desk_donut_left.png";
import botRight from "../assets/home_desktop/bot_right.svg";
import botLeft from "../assets/home_desktop/bot_left.svg";
import topLeft from "../assets/home_desktop/top_left.svg";
import topRight from "../assets/home_desktop/top_right.svg";

const HomeDesktop: React.FC = () => {
  return (
 <div>
        {/* --- Corner Decorations (positioned inside scaled frame) with responsive sizes --- */}
        <img
          src={topRight}
          alt="Top Right Decoration"
          style={{ position: "absolute", top: 0, right: 0, width: "50%", height: "auto" }}
        />
        <img
          src={botRight}
          alt="Bottom Right Decoration"
          style={{ position: "absolute", bottom: 0, right: 0, width: "58%", height: "auto" }}
        />
        <img
          src={botLeft}
          alt="Bottom Left Decoration"
          style={{ position: "absolute", bottom: 0, left: 0, width: "51%", height: "auto" }}
        />
        <img
          src={topLeft}
          alt="Top Left Decoration"
          style={{ position: "absolute", top: 0, left: 0, width: "57%", height: "auto" }}
        />
        <img
          src={donutLeft}
          alt="Donut Left"
          style={{ position: "absolute", top: 0, left: 0, width: "54%", height: "auto" }}
        />
        <img
          src={donutRight}
          alt="Donut Right"
          style={{ position: "absolute", bottom: 0, right: 0, width: "54%", height: "auto" }}
        />
      {/*</div>*/}
    </div>
  );
};

export default HomeDesktop;
